  const [sum, setSum] = useState(0);
  const [order, setOrder] = useState([]);

  useEffect(() => {
    fetch("http://127.0.0.1:8000/api/v1/orders/")
      .then((res) => res.json())
      .then((data) => setOrder(data));
  }, []);

